const FontSizes = () => {
  const fontSizes = [
    { id: 101, classTitle: 'XS', classValue: 'fsXS' },
    { id: 102, classTitle: 'SM', classValue: 'fsSM' },
    { id: 103, classTitle: 'MD', classValue: 'fsMD' },
    { id: 104, classTitle: 'LG', classValue: 'fsLG' },
    { id: 105, classTitle: 'XL', classValue: 'fsXL' },
    { id: 106, classTitle: 'H1', classValue: 'fsH1' },
    { id: 107, classTitle: 'H2', classValue: 'fsH2' },
    { id: 108, classTitle: 'H3', classValue: 'fsH3' },
    { id: 109, classTitle: 'H4', classValue: 'fsH4' },
    { id: 110, classTitle: 'H5', classValue: 'fsH5' },
    { id: 111, classTitle: 'H6', classValue: 'fsH6' },
  ];

  const fontsSizes = {
    id: 100,
    fSizes: [
      {
        id: 101,
        classTitle: 'fsDef',
        classValue: 'fsDef',
        fontValue: '1rem',
      },
      {
        id: 102,
        classTitle: 'fsXS',
        classValue: 'XS',
        fontValue: '0.9rem',
      },
      {
        id: 103,
        classTitle: 'fsSM',
        classValue: 'SM',
        fontValue: '1rem',
      },
      {
        id: 104,
        classTitle: 'fsMD',
        classValue: 'MD',
        fontValue: '1.1rem',
      },
      {
        id: 105,
        classTitle: 'fsLG',
        classValue: 'LG',
        fontValue: '1.2rem',
      },
      {
        id: 106,
        classTitle: 'fsXL',
        classValue: 'XL',
        fontValue: '1.4rem',
      },
      {
        id: 107,
        classTitle: 'fsXXL',
        classValue: 'XXL',
        fontValue: '2rem',
      },
    ],
  };

  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle fontStyled primary'>
          <h5 className='fsH5 pb2'>Font Sizes</h5>
          <h6 className='fsSM pb1'>Classes Names</h6>
        </div>

        {fontsSizes.fSizes.map((fss) => (
          <div key={fss.id} className='row alignCenter mb1'>
            <div className='col3 fwBold'>
              <p className='fsSM'>.{fss.classValue}:</p>
            </div>

            <div className='col3'>
              <h6 className={`fsSM lhDefault fontDefault ${fss.classTitle}`}>
                {fss.fontValue}
              </h6>
            </div>
            <div className='col3'>
              <h6 className={`fsSM lhDefault fontDefault ${fss.classTitle}`}>
                {fss.fontValue}
              </h6>
            </div>
          </div>
        ))}

        {fontSizes.map((fs) => (
          <div key={fs.id} className='row alignCenter mb1'>
            <div className='col3 fwBold'>
              <p className='fsSM'>.{fs.classValue}:</p>
            </div>

            <div className='col9'>
              <div className='displayFlex alignEnd'>
                <div className='col4 col3-xs col2-sm'>
                  <h1 className={`lh1 fontDefault ${fs.classValue}`}>
                    {fs.classTitle}
                  </h1>
                </div>
                <div className='col4 col3-xs col2-sm'>
                  <h1 className={`lh1 fontStyled ${fs.classValue}`}>
                    {fs.classTitle}
                  </h1>
                </div>
                <div className='col4 col3-xs col2-sm'>
                  <h1 className={`lh1 fontAccent ${fs.classValue}`}>
                    {fs.classTitle}
                  </h1>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default FontSizes;
